import React from 'react';
import { BrowserRouter } from 'react-router-dom';

// Simple test to check what's causing the error
const TestApp = () => {
  console.log('TestApp rendering...');
  
  return (
    <div className="min-h-screen bg-gray-50">
      <header className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 py-6">
          <h1 className="text-3xl font-bold text-gray-900">üçï Food Delivery</h1>
        </div>
      </header>
      
      <main className="max-w-7xl mx-auto px-4 py-8">
        <div className="text-center">
          <h2 className="text-4xl font-bold text-orange-600 mb-6">
            Debugging Mode
          </h2>
          <div className="bg-white rounded-lg shadow p-8 max-w-md mx-auto">
            <div className="text-6xl mb-4">ÔøΩ</div>
            <h3 className="text-2xl font-semibold text-blue-600 mb-2">
              Step 1: Basic App Working
            </h3>
            <p className="text-gray-600">
              If you see this, the basic React structure is fine. 
              The error is in the contexts or components.
            </p>
          </div>
        </div>
      </main>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <TestApp />
    </BrowserRouter>
  );
};

export default App;
